import React from 'react'
import '../bootstrap5/bootstrap.min.css'
import '../bootstrap5/font-awesome.min.css'

class Lisitra extends React.Component{
  render(){
    return(
      <>
        <h2>{this.props.nom}</h2>
        <ul className="list-group">
          {this.props.datas.map(arg => (<li key={arg.id} className="list-group-item"><a href="">{arg.nom}</a></li>))}
        </ul>
      </>
    )
  }
}

const anarana = "Laza"
const membres = [
  {id:1, nom: "RAZAFINJOELINA", prenom: "Tahiana", partie: "FTT", details: "Antoko Firaisankinan'ny Tia Tanindrazana",etat: false},
  {id:2, nom: "ANDRIANAINARIVELO", prenom: "Hajo", partie: "MMM", details: "Antoko Malagasy Miara-Miainga" ,etat: false},
  {id:3, nom: "RAJOELINA", prenom: "Andry Nirina", partie: "UPAR", details: "Antoko Union Pour Andry Rajoelina", etat: false},
  {id:4, nom: "RATSIRAKA", prenom: "Rolland", partie: "MTS", details: "Antoko Malagasy Miara-Miainga" ,etat: false},
  {id:5, nom: "RAVALOMANANA", prenom: "Marc", partie: "TIM", details: "Tiako I Madagasikara" ,etat: false},
  {id:6, nom: "PARAINA", prenom: "Auguste", partie: "TT", details: "Antoko Tsara Tahafina", etat: false},
  {id:7, nom: "RAOBELINA", prenom: "Andry", partie: "ARB", details: "Antoko Anjomara sy Rivo-Baovao", etat: false},
  {id:8, nom: "RAZAFITSIANDRAOFA", prenom: "Brunelle", partie: "APM", details: "Antoko Politika Madio", etat: false},
  {id:9, nom: "RATSIRAHONANA", prenom: "Lalaina", partie: "Fihavanantsika", details: "Antoko Fihavanantsika" ,etat: false},
  {id:10, nom: "RAJAONARIMAMPIANINA", prenom: "Hery", partie: "HVM", details: "Antoko Hery Vaovao an'i Madagasikara" ,etat: false},
  {id:11, nom: "RADERANIRINA", prenom: "Sendrison", partie: "Fy-M", details: "Antoko Fandrosoa Faritsy Iaby i Madagasikara",etat: false},
  {id:12, nom: "RATSIETISON", prenom: "Jean-Jacques", partie: "FMI", details: "Antoko Fahefa-Mividy Izao no ilain'ny Malagasy",etat: false},
  {id:13, nom: "RANDRIASOLONIAKO", prenom: "Siteny", partie: "NMA", details: "Ny Malagasy Aloha",etat: false}
]

function App() {
  return(
    <div className="container">
      <h1>Mianatra REACT</h1>
      <Lisitra nom={anarana} datas={membres} />
    </div>
  )
}
export default App
